import React from 'react'
import { makeStyles } from '@material-ui/core/styles';
import List from '@material-ui/core/List';
import ListItem from '@material-ui/core/ListItem';
import Divider from '@material-ui/core/Divider';
import ListItemText from '@material-ui/core/ListItemText';
import ListItemAvatar from '@material-ui/core/ListItemAvatar';
import Avatar from '@material-ui/core/Avatar';
import Typography from '@material-ui/core/Typography';
import {Link} from 'react-router-dom';


const useStyles = makeStyles((theme) => ({
  root: {
    width: '100%',
    maxWidth: '36ch',
    backgroundColor: theme.palette.background.paper,
  },
  inline: {
    display: 'inline',
  },
}));



const TodoList = ({todos}) => {
  const classes = useStyles();


const renderTodos = todos.map(todo => 

  <Link key={todo.id} to={`/todos/${todo.id}`}>
    <h1> {todo.message} </h1>

  </Link>

  )

  return (
    <List dense className={classes.root}>


    {


    todos.map((todo) => {
      const labelId = `checkbox-list-secondary-label-${todo.message}`;

      return (

        <ListItem key={todo.id} button>

          <ListItemAvatar>


          </ListItemAvatar>
          <Link key={todo.id} to={`/issues/${todo.id}`}  >  <ListItemText id={labelId} primary={` ${todo.message}`} />   </Link>

        </ListItem>


      );
    })}
  </List>
  )


}

export default TodoList;
